import { Component } from "react";

class TypeOfPoke extends Component{

    render(){
        
        const {monsters} = this.props;

        return(
            <div>
                {monsters.map((pokemon) =>(
                    
                    
                    pokemon.types.map((pokeType) => (

                        <button disabled="disabled">{pokeType.type.name}</button>

                    ))
                    

                ) )}
            </div>
        )
    }

}

export default TypeOfPoke;
